import React, { Component } from 'react';

class Commercant extends Component {
    render() {
        
        return (
            
                
                <div className="card mb-5">
                    
                    <div className="card-body">
                        
                    <div >
               <table>
    <tr>
      <th>Name</th>
    </tr>
    <tr>
      <td>John</td>
    </tr>
    <tr>
      <td>Elsa</td>
    </tr>
  </table>
            </div>

                    </div>
                </div>
            
        );


    }
}

export default Commercant;
